package com.active.bean;import java.io.Serializable;import java.util.Date;/** * 参观报名实体类 * * @author ta * @date 2019/6/30 下午8:43 * @since 1.0 */public class VisitInfo implements Serializable {    private Long id;    private String name;    private String mobile;    private String age;    /**行业**/    private String profession;    /**参观时间**/    private String visitTime;    private Date createTime;    private Date updateTime;    private Integer state;    private Integer page;    private Integer pageSize;    private Integer limit;    public Long getId() {        return id;    }    public void setId(Long id) {        this.id = id;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getMobile() {        return mobile;    }    public void setMobile(String mobile) {        this.mobile = mobile;    }    public String getAge() {        return age;    }    public void setAge(String age) {        this.age = age;    }    public String getProfession() {        return profession;    }    public void setProfession(String profession) {        this.profession = profession;    }    public String getVisitTime() {        return visitTime;    }    public void setVisitTime(String visitTime) {        this.visitTime = visitTime;    }    public Date getCreateTime() {        return createTime;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }    public Date getUpdateTime() {        return updateTime;    }    public void setUpdateTime(Date updateTime) {        this.updateTime = updateTime;    }    public Integer getState() {        return state;    }    public void setState(Integer state) {        this.state = state;    }    public Integer getPage() {        return page;    }    public void setPage(Integer page) {        this.page = page;    }    public Integer getLimit() {        return limit;    }    public void setLimit(Integer limit) {        this.limit = limit;    }    public Integer getPageSize() {        return pageSize;    }    public void setPageSize(Integer pageSize) {        this.pageSize = pageSize;    }}